import React, { useEffect, useState } from 'react';
import axios from 'axios';

const TelephoneLineView = ({ match }) => {
  const [telephoneLine, setTelephoneLine] = useState(null);

  useEffect(() => {
    const fetchTelephoneLine = async () => {
      const response = await axios.get(`/api/telephone-lines/${match.params.id}`);
      setTelephoneLine(response.data);
    };

    fetchTelephoneLine();
  }, [match.params.id]);

  if (!telephoneLine) return <div>Loading...</div>;

  return (
    <div className="telephone-line-view">
      <h1>Telephone Line Details</h1>
      <p>Numero de GSM: {telephoneLine.numero_de_gsm}</p>
      <p>Full Name: {telephoneLine.full_name}</p>
      <p>Code Entite: {telephoneLine.code_entite}</p>
      <p>Direction: {telephoneLine.direction}</p>
      <p>Fonction: {telephoneLine.fonction}</p>
      <p>Operateur: {telephoneLine.operateur}</p>
      <p>Categorie: {telephoneLine.categorie}</p>
      <p>Poste GSM: {telephoneLine.poste_GSM}</p>
    </div>
  );
};

export default TelephoneLineView;
